import React from 'react';
import styled from 'styled-components';

const BorderBlock = styled.div`
width: 85%;
height: 180px;

position: relative;
background: #FFFFFF;
border: 1px solid #000000;

margin: 0 auto;
padding-left: 50px;

margin-top: 32px;
display: flex;
align-items: center;
`

function StadiumPage({ name, address, image }) {
  return (
    <div>
        <BorderBlock>
            <img src={image} alt="stadium image" />
            <h3>{name}</h3>
            <p>{address}</p>
        </BorderBlock>
    </div>
  );
}

export default StadiumPage;
